<script>
var jQuery = require('jquery-easing')
import VueForm from 'vue-form'

var weekendInterval
var mobileTextInterval

export default {
  name: 'contact',
  mixins: [VueForm],
  data() {
    return {
      isInit: false,
      formstate: {},
      model: {
        name: '',
        email: '',
        req: ''
      }
    }
  },
  methods: {
    onSubmit: function() {
      var main = this

      if (this.formstate.$invalid) return

      jQuery.ajax({
        url: 'contact.php',
        type: 'post',
        data: {
          'name': main.$refs.name.value,
          'email': main.$refs.email.value,
          'req': main.$refs.name.value
        }
      }).done(function(response, textStatus, jqXHR) {
        jQuery('.contact form label, .contact form button').addClass('disable')
        jQuery('.contact form .success').addClass('yes')
      }).fail(function(jqXHR, textStatus, errorThrown) {
        console.error(
          "The following error occurred: " +
          textStatus, errorThrown
        )
      })
    }
  },
  mounted() {
    var page = this

    var bodyColorTimer = setTimeout(function() {
      jQuery('body').addClass('b-contact')
    }, 1200)

    // Animate weekend image
    var weekendImages = []
    var i = 1
    weekendImages[0] = jQuery('.contact .weekend img:nth-of-type(1)').attr('src')
    weekendImages[1] = jQuery('.contact .weekend img:nth-of-type(2)').attr('src')
    weekendImages[2] = jQuery('.contact .weekend img:nth-of-type(3)').attr('src')
    weekendInterval = setInterval(function() {
      jQuery('.contact .weekend img').css({
        'opacity': 0,
        'transform': 'translateY(-120px) rotate(-60deg)'
      })
      var weekendTimer_ = setTimeout(function() {
        jQuery('.contact .weekend img').css({
          'transform': 'translateY(120px) rotate(60deg)',
          'transition': 'none'
        })
        jQuery('.contact .weekend img').attr('src', weekendImages[i])
        i = i + 1
        if (i == 3) i = 0
        var weekendTimer_ = setTimeout(function() {
          jQuery('.contact .weekend img').css({
            'transition': '',
            'opacity': 1,
            'transform': 'translateY(0px) rotate(0deg)'
          })
        }, 150)
      }, 1000)
    }, 6000)

    // Animate mobile text
    var y = 1
    mobileTextInterval = setInterval(function() {
      if (y == 1) jQuery('.contact .hand #screen').addClass('sc')
      jQuery('.contact .hand #text' + y).addClass('textfade')
      if (y == 10) clearInterval(mobileTextInterval)
      else y++
    }, 3000)

    // Split on screen
    jQuery('.block').each(function(i, e) {
      var splitTimer = setTimeout(function() {
        jQuery(e).toggleClass('active', jQuery(e).offset().top < jQuery(window).height() - 120)
      }, 1500 + 300 * i)
    })
    jQuery('#app').scroll(function() {
      var d = jQuery(window).height() - 120
      jQuery('.block, .last').each(function() {
        var top = jQuery(this).offset().top
        jQuery(this).toggleClass('active', top < d)
      })
      jQuery('.scroll-btn').toggleClass('active', jQuery('#app').scrollTop() + window.innerHeight > jQuery('.page').height() - 90)
    })

    // Scroll button
    jQuery('.scroll-btn').click(function() {
      jQuery('#app').animate({
        scrollTop: 0
      }, 600, 'easeOutQuart')
    })

    var mountTimer = setTimeout(function() {
      page.isInit = true
    }, 1000)

  },
  beforeDestroy() {
    jQuery('#app').unbind('scroll')
    clearInterval(weekendInterval)
    clearInterval(mobileTextInterval)
  }
}
</script>
